module aes_rcon (
   // Outputs
   out,
   // Inputs
   clk, kld
   ) ;
   // System Input
   input          clk;
   // Cipher Control
   input          kld;
   // Outputs
   output [31:0]  out;
   // Outputs
   reg [31:0]     out;
   // Registers
   reg [3:0]      rcnt;
   // Wire Declarations
   wire [3:0]     rcnt_next;
   wire [31:0]    out_next;
   // Combinational Logic
   assign rcnt_next = rcnt + 1;
   assign out_next = {out[31:24], (out[23:0] << 1) ^ (out[31:24] & 8'h1b)};
   // Sequential Logic
   always @ (posedge clk)
     if (kld) begin
        rcnt <= 4'h0;
        out <= 32'h01_00_00_00;
     end else begin
        rcnt <= rcnt_next;
        out <= out_next;
     end
endmodule

