module aes_rcon (
   // Outputs
   out,
   // Inputs
   clk, kld
   ) ;
   input          clk;
   input          kld;
   output [31:0]  out;
   reg [3:0]      rcnt;
   reg [31:0]     out;
   //--------------------------------------------------------------------
   // Round constant table
   //--------------------------------------------------------------------
   wire [7:0]     rcon_table [0:9];
   assign rcon_table[0] = 8'h01;
   assign rcon_table[1] = 8'h02;
   assign rcon_table[2] = 8'h04;
   assign rcon_table[3] = 8'h08;
   assign rcon_table[4] = 8'h10;
   assign rcon_table[5] = 8'h20;
   assign rcon_table[6] = 8'h40;
   assign rcon_table[7] = 8'h80;
   assign rcon_table[8] = 8'h1b;
   assign rcon_table[9] = 8'h36;
   //--------------------------------------------------------------------
   // State machine
   //--------------------------------------------------------------------
   localparam S_IDLE = 0;
   localparam S_INIT = 1;
   localparam S_RUN  = 2;
   reg [1:0] state;
   always @(posedge clk)
     begin : STATE_MACHINE
        if (kld) begin
           state <= S_INIT;
        end else begin
           case (state)
             S_INIT : begin
                state <= S_RUN;
             end
             S_RUN : begin
                if (rcnt == 9) begin
                   state <= S_IDLE;
                end
             end
             default : begin
                state <= S_IDLE;
             end
           endcase // case (state)
        end
     end // block: STATE_MACHINE
   //--------------------------------------------------------------------
   // Counter
   //--------------------------------------------------------------------
   always @(posedge clk)
     begin : COUNTER
        if (kld) begin
           rcnt <= 4'h0;
        end else begin
           if (state == S_RUN) begin
              rcnt <= rcnt + 1;
           end
        end
     end // block: COUNTER
   //--------------------------------------------------------------------
   // Output
   //--------------------------------------------------------------------
   always @(posedge clk)
     begin : OUTPUT
        if (kld) begin
           out <= 32'h01_00_00_00;
        end else begin
           if (state == S_RUN) begin
              out <= {24'h000000, rcon_table[rcnt]};
           end
        end
     end // block: OUTPUT
endmodule

